import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div className="Navbar">
      <h3>LOGO</h3 >

      <ul className="Links">
        <Link to="/" >
          <li>Home</li>
        </Link>

        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
  );
}

export default Navbar;
